import { useState } from "react/cjs/react.production.min";
import Expenses from "./components/Expenses/Expenses"
import NewExpense from "./components/NewExpense/NewExpense"




function App() {

  const INITIAL_EXPANSES = [
    {
      date : new Date(2022,2,10),
      title :"Car Insurance",
      amount : 297.64
    },
      {
      date : new Date(2022,2,11),
      title :"Car Insurance",
      amount : 297.64
    },
    {
      date : new Date(2022,2,12),
      title :"Car Insurance",
      amount : 297.64
    }]
  const [expenses,setExpenses] = useState(INITIAL_EXPANSES);

  const ExpenseDataCreatedHandler = ( expenseData ) =>
  {
    console.log(expenseData);
    setExpenses((prevExpenses) => {
      return [...prevExpenses,expenseData];
    })  
  };


  return (

    <div>

      <h2>Let's get started!</h2>
      <NewExpense onExpenseDataCreated={ExpenseDataCreatedHandler}></NewExpense>

      <Expenses items={INITIAL_EXPANSES}></Expenses>
    </div>
  );
}

export default App;
